import Formularios from "./components/Formularios";
import AppRouter from "./routers/AppRouter";

function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
        <AppRouter />
        <Formularios />

        </div>
        <hr/>
      </div>
    </div>
  );
}

export default App;
